PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE attendance_records (
	id INTEGER NOT NULL, 
	employee_id VARCHAR NOT NULL, 
	date DATE NOT NULL, 
	status VARCHAR NOT NULL, 
	note VARCHAR, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, overtime_minutes INTEGER, overtime_rate FLOAT, late_minutes INTEGER, late_deduction FLOAT, leave_type VARCHAR, fine_amount FLOAT, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_attendance_employee_date UNIQUE (employee_id, date)
);
CREATE TABLE client_addresses (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	address_type VARCHAR(30) NOT NULL, 
	address_line1 VARCHAR(200) NOT NULL, 
	address_line2 VARCHAR(200), 
	city VARCHAR(80), 
	state VARCHAR(80), 
	country VARCHAR(80), 
	postal_code VARCHAR(30), 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE client_contacts (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	name VARCHAR(120) NOT NULL, 
	designation VARCHAR(120), 
	phone_number VARCHAR(50), 
	alternate_phone VARCHAR(50), 
	email VARCHAR(200), 
	preferred_contact_method VARCHAR(30), 
	is_primary INTEGER NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE client_contracts (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	contract_number VARCHAR(80) NOT NULL, 
	start_date DATE, 
	end_date DATE, 
	contract_type VARCHAR(30), 
	billing_cycle VARCHAR(30), 
	payment_terms VARCHAR(30), 
	penalty_overtime_rules TEXT, 
	status VARCHAR(30) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, monthly_cost FLOAT, notes TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE client_documents (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	document_type VARCHAR(50) NOT NULL, 
	file_url VARCHAR(300) NOT NULL, 
	expiry_date DATE, 
	remarks TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE client_guard_requirements (
	id INTEGER NOT NULL, 
	site_id INTEGER NOT NULL, 
	guard_type VARCHAR(50) NOT NULL, 
	number_of_guards INTEGER NOT NULL, 
	shift_type VARCHAR(30), 
	shift_start VARCHAR(20), 
	shift_end VARCHAR(20), 
	weekly_off_rules VARCHAR(200), 
	special_instructions TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, start_date DATE, end_date DATE, preferred_language VARCHAR, monthly_amount FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(site_id) REFERENCES client_sites (id)
);
CREATE TABLE client_invoices (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	invoice_number VARCHAR(80) NOT NULL, 
	invoice_date DATE, 
	billing_period VARCHAR(80), 
	total_amount FLOAT NOT NULL, 
	tax_amount FLOAT, 
	net_payable FLOAT NOT NULL, 
	payment_status VARCHAR(30) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE client_rate_cards (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	guard_type VARCHAR(50) NOT NULL, 
	rate_per_shift_day_month FLOAT NOT NULL, 
	overtime_rate FLOAT, 
	holiday_rate FLOAT, 
	effective_from DATE, 
	effective_to DATE, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE "client_site_guard_allocations" (
            id INTEGER PRIMARY KEY,
            site_id INTEGER,
            contract_id INTEGER,
            requirement_id INTEGER,
            employee_db_id INTEGER NOT NULL,
            start_date DATE,
            end_date DATE,
            status VARCHAR(30) NOT NULL DEFAULT 'Allocated',
            created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
            updated_at DATETIME
        );
CREATE TABLE client_sites (
	id INTEGER NOT NULL, 
	client_id INTEGER NOT NULL, 
	site_name VARCHAR(200) NOT NULL, 
	site_type VARCHAR(50), 
	site_address VARCHAR(250), 
	city VARCHAR(80), 
	latitude FLOAT, 
	longitude FLOAT, 
	risk_level VARCHAR(20) NOT NULL, 
	status VARCHAR(30) NOT NULL, 
	site_instructions TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(client_id) REFERENCES clients (id)
);
CREATE TABLE clients (
	id INTEGER NOT NULL, 
	client_code VARCHAR(50) NOT NULL, 
	client_name VARCHAR(200) NOT NULL, 
	client_type VARCHAR(50) NOT NULL, 
	industry_type VARCHAR(80), 
	status VARCHAR(30) NOT NULL, 
	registration_number VARCHAR(80), 
	vat_gst_number VARCHAR(80), 
	website VARCHAR(200), 
	notes TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, location VARCHAR(200), address TEXT, phone VARCHAR(50), email VARCHAR(200), 
	PRIMARY KEY (id)
);
CREATE TABLE employee_advance_deductions (
	id INTEGER NOT NULL, 
	employee_db_id INTEGER NOT NULL, 
	month VARCHAR(7) NOT NULL, 
	amount FLOAT NOT NULL, 
	note VARCHAR(500), 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_employee_advance_deduction_employee_month UNIQUE (employee_db_id, month), 
	FOREIGN KEY(employee_db_id) REFERENCES employees (id)
);
CREATE TABLE employee_advances (
	id INTEGER NOT NULL, 
	employee_db_id INTEGER NOT NULL, 
	amount FLOAT NOT NULL, 
	note VARCHAR(500), 
	advance_date DATE NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(employee_db_id) REFERENCES employees (id)
);
CREATE TABLE employee_documents (
	id INTEGER NOT NULL, 
	employee_db_id INTEGER NOT NULL, 
	name VARCHAR(150) NOT NULL, 
	filename VARCHAR(255) NOT NULL, 
	path VARCHAR(500) NOT NULL, 
	mime_type VARCHAR(120) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(employee_db_id) REFERENCES employees (id)
);
CREATE TABLE employee_warning_documents (
	id INTEGER NOT NULL, 
	warning_id INTEGER NOT NULL, 
	filename VARCHAR(255) NOT NULL, 
	path VARCHAR(500) NOT NULL, 
	mime_type VARCHAR(120) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(warning_id) REFERENCES employee_warnings (id)
);
CREATE TABLE employee_warnings (
	id INTEGER NOT NULL, 
	employee_db_id INTEGER NOT NULL, 
	warning_number VARCHAR(100) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, found_with TEXT, supervisor_signature VARCHAR, supervisor_signature_date VARCHAR, notice_text TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(employee_db_id) REFERENCES employees (id)
);
CREATE TABLE employees (
	id INTEGER NOT NULL, 
	employee_id VARCHAR NOT NULL, 
	first_name VARCHAR NOT NULL, 
	last_name VARCHAR NOT NULL, 
	gender VARCHAR, 
	date_of_birth VARCHAR, 
	profile_photo TEXT, 
	government_id VARCHAR, 
	email VARCHAR, 
	mobile_number VARCHAR, 
	emergency_contact_name VARCHAR, 
	emergency_contact_number VARCHAR, 
	father_name VARCHAR, 
	previous_employment TEXT, 
	next_of_kin_name VARCHAR, 
	address_line1 VARCHAR, 
	address_line2 VARCHAR, 
	city VARCHAR, 
	state VARCHAR, 
	postal_code VARCHAR, 
	department VARCHAR, 
	designation VARCHAR, 
	employment_type VARCHAR, 
	shift_type VARCHAR, 
	reporting_manager VARCHAR, 
	base_location VARCHAR, 
	security_clearance VARCHAR, 
	basic_security_training BOOLEAN, 
	fire_safety_training BOOLEAN, 
	first_aid_certification BOOLEAN, 
	other_certificates TEXT, 
	basic_salary VARCHAR, 
	allowances VARCHAR, 
	bank_name VARCHAR, 
	account_number VARCHAR, 
	ifsc_code VARCHAR, 
	tax_id VARCHAR, 
	system_access_rights TEXT, 
	employment_status VARCHAR, 
	last_site_assigned VARCHAR, 
	remarks TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, police_clearance BOOLEAN DEFAULT 0, fingerprint_check BOOLEAN DEFAULT 0, background_screening BOOLEAN DEFAULT 0, reference_verification BOOLEAN DEFAULT 0, guard_card BOOLEAN DEFAULT 0, police_clearance_doc TEXT, fingerprint_check_doc TEXT, background_screening_doc TEXT, reference_verification_doc TEXT, total_salary VARCHAR, account_type VARCHAR, guard_card_doc TEXT, languages_spoken TEXT, height_cm INTEGER, languages_proficiency TEXT, permanent_address TEXT, temporary_address TEXT, cnic VARCHAR, cnic_expiry_date VARCHAR, personal_phone_number VARCHAR, next_of_kin_cnic VARCHAR, next_of_kin_mobile_number VARCHAR, permanent_village VARCHAR, permanent_post_office VARCHAR, permanent_thana VARCHAR, permanent_tehsil VARCHAR, permanent_district VARCHAR, present_village VARCHAR, present_post_office VARCHAR, present_thana VARCHAR, present_tehsil VARCHAR, present_district VARCHAR, enrolled_as VARCHAR, interviewed_by VARCHAR, introduced_by VARCHAR, retired_from TEXT, service_unit VARCHAR, service_rank VARCHAR, service_enrollment_date VARCHAR, service_reenrollment_date VARCHAR, medical_category VARCHAR, discharge_cause TEXT, blood_group VARCHAR, civil_education_type VARCHAR, civil_education_detail VARCHAR, sons_names TEXT, daughters_names TEXT, brothers_names TEXT, sisters_names TEXT, particulars_verified_by_sho_on VARCHAR, particulars_verified_by_ssp_on VARCHAR, signature_recording_officer TEXT, signature_individual TEXT, fss_number VARCHAR, fss_name VARCHAR, fss_so VARCHAR, original_doc_held TEXT, fingerprint_attested_by VARCHAR, police_khidmat_verification_on VARCHAR, domicile VARCHAR, agreement BOOLEAN DEFAULT 0, bank_accounts TEXT, documents_handed_over_to VARCHAR, photo_on_document VARCHAR, eobi_no VARCHAR, insurance VARCHAR, social_security VARCHAR, home_contact_no VARCHAR, police_training_letter_date VARCHAR, vaccination_certificate VARCHAR, volume_no VARCHAR, payments TEXT, verified_by_khidmat_markaz VARCHAR, date_of_entry VARCHAR, card_number VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE employees2 (
	id INTEGER NOT NULL, 
	serial_no VARCHAR, 
	fss_no VARCHAR, 
	rank VARCHAR, 
	name VARCHAR NOT NULL, 
	father_name VARCHAR, 
	salary VARCHAR, 
	status VARCHAR, 
	unit VARCHAR, 
	service_rank VARCHAR, 
	blood_group VARCHAR, 
	status2 VARCHAR, 
	unit2 VARCHAR, 
	rank2 VARCHAR, 
	cnic VARCHAR, 
	dob VARCHAR, 
	cnic_expiry VARCHAR, 
	documents_held TEXT, 
	documents_handed_over_to TEXT, 
	photo_on_doc VARCHAR, 
	eobi_no VARCHAR, 
	insurance VARCHAR, 
	social_security VARCHAR, 
	mobile_no VARCHAR, 
	home_contact VARCHAR, 
	verified_by_sho VARCHAR, 
	verified_by_khidmat_markaz VARCHAR, 
	domicile VARCHAR, 
	verified_by_ssp VARCHAR, 
	enrolled VARCHAR, 
	re_enrolled VARCHAR, 
	village VARCHAR, 
	post_office VARCHAR, 
	thana VARCHAR, 
	tehsil VARCHAR, 
	district VARCHAR, 
	duty_location VARCHAR, 
	police_trg_ltr_date VARCHAR, 
	vaccination_cert VARCHAR, 
	vol_no VARCHAR, 
	payments TEXT, 
	category VARCHAR, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, designation VARCHAR, allocation_status VARCHAR, avatar_url TEXT, cnic_attachment TEXT, domicile_attachment TEXT, sho_verified_attachment TEXT, ssp_verified_attachment TEXT, khidmat_verified_attachment TEXT, police_trg_attachment TEXT, bank_accounts TEXT, 
	PRIMARY KEY (id)
);
CREATE TABLE expenses (
	id INTEGER NOT NULL, 
	expense_date DATE NOT NULL, 
	category VARCHAR(100) NOT NULL, 
	description VARCHAR(500) NOT NULL, 
	amount NUMERIC(14, 2) NOT NULL, 
	vendor_name VARCHAR(255), 
	receipt_number VARCHAR(100), 
	notes TEXT, 
	account_id INTEGER, 
	journal_entry_id INTEGER, 
	employee_id INTEGER, 
	status VARCHAR(20) NOT NULL, 
	is_active BOOLEAN NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	updated_at DATETIME, 
	approved_at DATETIME, 
	paid_at DATETIME, attachment_url VARCHAR(500), 
	PRIMARY KEY (id), 
	FOREIGN KEY(account_id) REFERENCES finance_accounts (id), 
	FOREIGN KEY(journal_entry_id) REFERENCES finance_journal_entries (id), 
	FOREIGN KEY(employee_id) REFERENCES employees (id)
);
CREATE TABLE finance_accounts (
	id INTEGER NOT NULL, 
	code VARCHAR(50) NOT NULL, 
	name VARCHAR(255) NOT NULL, 
	account_type VARCHAR(20) NOT NULL, 
	parent_id INTEGER, 
	is_system BOOLEAN NOT NULL, 
	is_active BOOLEAN NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(parent_id) REFERENCES finance_accounts (id)
);
CREATE TABLE finance_journal_entries (
	id INTEGER NOT NULL, 
	entry_no VARCHAR(50) NOT NULL, 
	entry_date DATE NOT NULL, 
	memo VARCHAR(500), 
	source_type VARCHAR(50), 
	source_id VARCHAR(50), 
	status VARCHAR(20) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	posted_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE finance_journal_lines (
	id INTEGER NOT NULL, 
	entry_id INTEGER NOT NULL, 
	account_id INTEGER NOT NULL, 
	description VARCHAR(500), 
	debit NUMERIC(14, 2) NOT NULL, 
	credit NUMERIC(14, 2) NOT NULL, 
	employee_id INTEGER, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(entry_id) REFERENCES finance_journal_entries (id) ON DELETE CASCADE, 
	FOREIGN KEY(account_id) REFERENCES finance_accounts (id), 
	FOREIGN KEY(employee_id) REFERENCES employees (id)
);
CREATE TABLE fuel_entries (
	id INTEGER NOT NULL, 
	vehicle_id VARCHAR(50) NOT NULL, 
	entry_date DATE NOT NULL, 
	fuel_type VARCHAR(30), 
	liters FLOAT NOT NULL, 
	price_per_liter FLOAT, 
	total_cost FLOAT, 
	odometer_km INTEGER, 
	vendor VARCHAR(200), 
	location VARCHAR(200), 
	notes VARCHAR(500), 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE general_item_employee_balances (
	id INTEGER NOT NULL, 
	employee_id VARCHAR(50) NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	quantity_issued FLOAT NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(employee_id) REFERENCES employees (employee_id), 
	FOREIGN KEY(item_code) REFERENCES general_items (item_code)
);
CREATE TABLE general_item_transactions (
	id INTEGER NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	employee_id VARCHAR(50), 
	action VARCHAR(30) NOT NULL, 
	quantity FLOAT, 
	condition_note VARCHAR(120), 
	notes TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(item_code) REFERENCES general_items (item_code), 
	FOREIGN KEY(employee_id) REFERENCES employees (employee_id)
);
CREATE TABLE general_items (
	id INTEGER NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	category VARCHAR(50) NOT NULL, 
	name VARCHAR(200) NOT NULL, 
	description TEXT, 
	unit_name VARCHAR(50) NOT NULL, 
	quantity_on_hand FLOAT NOT NULL, 
	min_quantity FLOAT, 
	storage_location VARCHAR(120), 
	status VARCHAR(30) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, image_url VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE inventory_assignments_state (
	id INTEGER NOT NULL, 
	data TEXT NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE leave_periods (
	id INTEGER NOT NULL, 
	employee_id VARCHAR NOT NULL, 
	from_date DATE NOT NULL, 
	to_date DATE NOT NULL, 
	leave_type VARCHAR NOT NULL, 
	reason VARCHAR, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE payroll_fines (
	id INTEGER NOT NULL, 
	employee_db_id INTEGER NOT NULL, 
	month VARCHAR(7) NOT NULL, 
	warning_fine FLOAT NOT NULL, 
	performance_fine FLOAT NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_payroll_fines_employee_month UNIQUE (employee_db_id, month), 
	FOREIGN KEY(employee_db_id) REFERENCES employees (id)
);
CREATE TABLE payroll_payment_status (
	id INTEGER NOT NULL, 
	month VARCHAR(7) NOT NULL, 
	employee_id VARCHAR(50) NOT NULL, 
	status VARCHAR(10) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, employee_db_id INTEGER, net_pay_snapshot FLOAT, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_payroll_payment_month_employee UNIQUE (month, employee_id)
);
CREATE TABLE payroll_sheet_entries (
	id INTEGER NOT NULL, 
	employee_db_id INTEGER NOT NULL, 
	from_date DATE NOT NULL, 
	to_date DATE NOT NULL, 
	pre_days_override INTEGER, 
	cur_days_override INTEGER, 
	leave_encashment_days INTEGER NOT NULL, 
	allow_other FLOAT NOT NULL, 
	eobi FLOAT NOT NULL, 
	tax FLOAT NOT NULL, 
	fine_adv_extra FLOAT NOT NULL, 
	remarks VARCHAR(500), 
	bank_cash VARCHAR(50), 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_payroll_sheet_entries_employee_period UNIQUE (employee_db_id, from_date, to_date), 
	FOREIGN KEY(employee_db_id) REFERENCES employees (id)
);
CREATE TABLE permissions (
	id INTEGER NOT NULL, 
	"key" VARCHAR NOT NULL, 
	description VARCHAR, 
	PRIMARY KEY (id), 
	CONSTRAINT uq_permissions_key UNIQUE ("key")
);
CREATE TABLE restricted_item_employee_balances (
	id INTEGER NOT NULL, 
	employee_id VARCHAR(50) NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	quantity_issued FLOAT NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(employee_id) REFERENCES employees (employee_id), 
	FOREIGN KEY(item_code) REFERENCES restricted_items (item_code)
);
CREATE TABLE restricted_item_images (
	id INTEGER NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	filename VARCHAR(255) NOT NULL, 
	path VARCHAR(500) NOT NULL, 
	mime_type VARCHAR(120) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(item_code) REFERENCES restricted_items (item_code)
);
CREATE TABLE restricted_item_serial_units (
	id INTEGER NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	serial_number VARCHAR(120) NOT NULL, 
	status VARCHAR(30) NOT NULL, 
	issued_to_employee_id VARCHAR(50), 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(item_code) REFERENCES restricted_items (item_code)
);
CREATE TABLE restricted_item_transactions (
	id INTEGER NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	employee_id VARCHAR(50), 
	serial_unit_id INTEGER, 
	action VARCHAR(30) NOT NULL, 
	quantity FLOAT, 
	condition_note VARCHAR(120), 
	notes TEXT, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	PRIMARY KEY (id), 
	FOREIGN KEY(item_code) REFERENCES restricted_items (item_code), 
	FOREIGN KEY(employee_id) REFERENCES employees (employee_id), 
	FOREIGN KEY(serial_unit_id) REFERENCES restricted_item_serial_units (id)
);
CREATE TABLE restricted_items (
	id INTEGER NOT NULL, 
	item_code VARCHAR(50) NOT NULL, 
	category VARCHAR(50) NOT NULL, 
	name VARCHAR(200) NOT NULL, 
	description TEXT, 
	is_serial_tracked BOOLEAN, 
	unit_name VARCHAR(50) NOT NULL, 
	quantity_on_hand FLOAT NOT NULL, 
	min_quantity FLOAT, 
	make_model VARCHAR(200), 
	caliber VARCHAR(50), 
	storage_location VARCHAR(120), 
	requires_maintenance BOOLEAN, 
	requires_cleaning BOOLEAN, 
	status VARCHAR(30) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE role_permissions (
	role_id INTEGER NOT NULL, 
	permission_id INTEGER NOT NULL, 
	PRIMARY KEY (role_id, permission_id), 
	FOREIGN KEY(role_id) REFERENCES roles (id), 
	FOREIGN KEY(permission_id) REFERENCES permissions (id)
);
CREATE TABLE roles (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	description VARCHAR, 
	is_system BOOLEAN, 
	PRIMARY KEY (id)
);
CREATE TABLE user_roles (
	user_id INTEGER NOT NULL, 
	role_id INTEGER NOT NULL, 
	PRIMARY KEY (user_id, role_id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	FOREIGN KEY(role_id) REFERENCES roles (id)
);
CREATE TABLE users (
	id INTEGER NOT NULL, 
	email VARCHAR NOT NULL, 
	username VARCHAR NOT NULL, 
	full_name VARCHAR, 
	hashed_password VARCHAR NOT NULL, 
	is_active BOOLEAN, 
	is_superuser BOOLEAN, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE vehicle_assignments (
	id INTEGER NOT NULL, 
	vehicle_id VARCHAR(50) NOT NULL, 
	employee_ids TEXT NOT NULL, 
	route_from VARCHAR(200) NOT NULL, 
	route_to VARCHAR(200) NOT NULL, 
	notes TEXT, 
	start_time DATETIME DEFAULT CURRENT_TIMESTAMP, 
	end_time DATETIME, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, route_stops TEXT, status VARCHAR(30) DEFAULT 'Incomplete', distance_km FLOAT, rate_per_km FLOAT, amount FLOAT, assignment_date DATE, 
	PRIMARY KEY (id)
);
CREATE TABLE vehicle_documents (
	id INTEGER NOT NULL, 
	vehicle_id VARCHAR(50) NOT NULL, 
	name VARCHAR(150) NOT NULL, 
	filename VARCHAR(255) NOT NULL, 
	path VARCHAR(500) NOT NULL, 
	mime_type VARCHAR(120) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(vehicle_id) REFERENCES vehicles (vehicle_id)
);
CREATE TABLE vehicle_images (
	id INTEGER NOT NULL, 
	vehicle_id VARCHAR(50) NOT NULL, 
	filename VARCHAR(255) NOT NULL, 
	path VARCHAR(500) NOT NULL, 
	mime_type VARCHAR(120) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(vehicle_id) REFERENCES vehicles (vehicle_id)
);
CREATE TABLE vehicle_maintenance (
	id INTEGER NOT NULL, 
	vehicle_id VARCHAR(50) NOT NULL, 
	employee_id VARCHAR, 
	description VARCHAR(255), 
	maintenance_date DATE NOT NULL, 
	cost FLOAT, 
	odometer_km INTEGER, 
	service_vendor VARCHAR(200), 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE vehicles (
	id INTEGER NOT NULL, 
	vehicle_id VARCHAR(50) NOT NULL, 
	vehicle_type VARCHAR(100) NOT NULL, 
	category VARCHAR(50) NOT NULL, 
	make_model VARCHAR(200) NOT NULL, 
	license_plate VARCHAR(50) NOT NULL, 
	asset_tag VARCHAR(50), 
	year INTEGER NOT NULL, 
	status VARCHAR(50) NOT NULL, 
	compliance VARCHAR(50) NOT NULL, 
	government_permit VARCHAR(100) NOT NULL, 
	created_at DATETIME DEFAULT CURRENT_TIMESTAMP, 
	updated_at DATETIME, chassis_number VARCHAR(100), 
	PRIMARY KEY (id)
);
